INSERT INTO `session_report` (`report_id`, `session_id`, `summary`, `generated_at`) VALUES
(3, 3, 'Ringkasan Percakapan:\n\n*   **Poin Penting:** Percakapan dimulai dengan sapaan penyemangat, diikuti keluhan tentang rasa malas. Kemudian, ada pujian terhadap pekerjaan seseorang dan pertanyaan umum tentang apa yang terjadi hari ini.\n*   **Suasana Diskusi:** Suasana terkesan santai dan informal, ditandai dengan penggunaan bahasa sehari-hari seperti \"kakak,\" \"sumpah,\" \"coy,\" dan \"wow banget.\" Ada campuran antara semangat, keluhan, dan rasa ingin tahu.\n', '2025-05-27 04:48:23'),
(4, 4, 'Berikut ringkasan percakapan tersebut:\n\n**Poin-poin Penting:**\n\n*   **Member 1:** Memberikan semangat.\n*   **Member 2:** Menanggapi dengan kurang antusias atau bahkan sinis (\"apaan sih\").\n*   **Leader:** Menyatakan ketidakpercayaan atau kekecewaan atas sesuatu yang terjadi, padahal merasa sudah diselesaikan (\"ah mana mungkin ini terjadi, padahal udah beres\").\n\n**Suasana Diskusi:**\n\nSuasana diskusi tampaknya **tegang dan mungkin frustrasi**. Ada kontras antara semangat yang diberikan oleh member pertama dan reaksi negatif dari member kedua dan leader. Pernyataan leader mengindikasikan adanya masalah atau kemunduran yang tidak terduga setelah merasa masalah tersebut sudah diatasi.\n', '2025-05-27 10:41:54'),
(5, 5, 'Ringkasan:\n\nPercakapan singkat ini menunjukkan suasana positif dan penuh semangat. Sang pemimpin memulai dengan sapaan ramah dan penyemangat, yang kemudian direspon positif oleh anggota tim yang menyatakan suasana hatinya sedang baik. Poin pentingnya adalah penekanan pada semangat dan suasana positif di awal hari.\n', '2025-05-27 11:01:27'),
(6, 6, 'Ringkasan Percakapan:\n\n*   **Poin Penting:** Percakapan dimulai dengan sapaan semangat dari seorang pemimpin (\"leader@example.com\") kepada timnya (\"semangat kakak\"). Ucup merespon dengan sapaan pagi.\n*   **Suasana Diskusi:** Suasana percakapan terkesan santai dan ramah, diawali dengan sapaan penyemangat.\n', '2025-05-30 12:57:52'),
(7, 8, '**Ringkasan:**\n\nPercakapan ini didominasi oleh keluhan dan ekspresi kelelahan dari kedua belah pihak, terutama dari `leader@example.com`.  `member@example.com` awalnya mengeluh tentang kelelahan kerja.  `leader@example.com` kemudian merespon dengan semangat, tetapi dengan cepat ikut larut dalam perasaan lelah, malas, dan *badmood*.  `leader@example.com` berulang kali menyatakan perasaan tersebut, diselingi dengan sedikit dorongan semangat untuk `member@example.com`. Percakapan diakhiri dengan `leader@example.com` yang menyatakan akan beristirahat dan memberikan semangat kepada member. Terdapat satu pesan dalam bahasa lain (kemungkinan Sunda) yang tidak diterjemahkan.\n\n**Poin-poin Penting:**\n\n*   `member@example.com` mengeluhkan kelelahan kerja.\n*   `leader@example.com` awalnya memberikan semangat, tetapi kemudian ikut mengungkapkan perasaan lelah, malas, dan *badmood*.\n*   `leader@example.com` mencoba memberikan semangat kepada `member@example.com` di tengah keluhannya sendiri.\n*   `leader@example.com` memutuskan untuk beristirahat.\n*   `member@example.com` menyebutkan \"parah banget toxic\"\n\n**Suasana Diskusi:**\n\nSuasana diskusi terasa negatif dan penuh keluhan. Meskipun ada upaya untuk saling menyemangati, perasaan lelah dan malas mendominasi percakapan. Adanya komentar \"parah banget toxic\" dari member menunjukkan adanya ketidaknyamanan atau perasaan negatif yang lebih dalam.\n', '2025-06-03 03:26:47');
